// src/components/Navbar.js
import React, { useState } from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-toggle" onClick={toggleMobileMenu}>
        <span className="hamburger-icon"></span>
      </div>
      <ul className={`navbar-links ${isMobileMenuOpen ? 'mobile-menu' : ''}`}>
        <li>
          <Link
            to="hero"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
            onClick={toggleMobileMenu} // Close the mobile menu on click
          >
            Home
          </Link>
        </li>
        <li>
          <Link
            to="bio"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
            onClick={toggleMobileMenu}
          >
            Bio
          </Link>
        </li>
        <li>
          <Link
            to="experience"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
            onClick={toggleMobileMenu}
          >
            Experience
          </Link>
        </li>
        <li>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
            onClick={toggleMobileMenu}
          >
            Projects
          </Link>
        </li>
        <li>
          <Link
            to="contact"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
            onClick={toggleMobileMenu}
          >
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
